import React, {Component} from 'react';
import Particles from 'react-particles-js';

function Page(){
	return(
		<div >
			<Particles 
              params={{
            		particles: {
            			line_linked: {
            				shadow: {
            					enable: true,
            					color: "#3CA9D1",
            				}
            			}
            		}
            	}}
              style={{
                width: '100%',
              }}
            />
        </div>
	)
}

export default Page;
